sympy.sympy.polys.densetools.dup_diff:
def dup_diff(f: dup[Er], m: int, K: Domain[Er]) -> dup[Er]:
    """
    ``m``-th order derivative of a polynomial in ``K[x]``.

    Examples
    ========

    >>> from sympy.polys import ring, ZZ
    >>> R, x = ring("x", ZZ)

    >>> R.dup_diff(x**3 + 2*x**2 + 3*x + 4, 1)
    3*x**2 + 4*x + 3
    >>> R.dup_diff(x**3 + 2*x**2 + 3*x + 4, 2)
    6*x + 4

    """
    if m <= 0:
        return f

    n = dup_degree(f)

    if n < m:
        return []

    deriv: list[Er] = []

    if m == 1:
        for coeff in f[:-m]:
            deriv.append(K(n)*coeff)
            n -= 1
    else:
        for coeff in f[:-m]:
            k = n

            for i in range(n - 1, n - m, -1):
                k *= i

            deriv.append(K(k)*coeff)
            n -= 1

    return dup_strip(deriv, K)

sympy.sympy.polys.domains.algebraicfield:
def is_negative(self, a):
    """Returns True if ``a`` is negative. """
    return self.dom.is_negative(a.LC())

sympy.sympy.polys.domains.domain.is_nega:
def is_negative(self, a: Er) -> bool:
    """Returns True if ``a`` is negative. """
    return a < 0 # type: ignore

def is_negative(self, a):
    """Returns True if ``LC(a)`` is negative. """
    return self.domain.is_negative(a.numer.LC)

sympy.sympy.polys.sqfreetools.dup_gf_sqf:
def dup_gf_sqf_part(f, K):
    """Compute square-free part of ``f`` in ``GF(p)[x]``. """
    f = dup_convert(f, K, K.dom)
    g = gf_sqf_part(f, K.mod, K.dom)
    return dup_convert(g, K.dom, K)
